import React, { Component } from 'react';
import './App.css';
import axios from 'axios';

class App extends Component {
  state = {
    processed_images: []
  }

  async componentDidMount() {
    const processed_image = await axios.get('http://127.0.0.1:5000/generate');
    this.setState({ processed_image: processed_image.data });
  }

  render() {
    const { processed_image } = this.state;

    return (
      <div className="App">
        <header className="App-header">
          <img src={`data:image/jpeg;base64,${processed_image}`} alt="album art" />
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
  }
}

export default App;
